    "2015-09-26T21:07:45.328490",nt"name": "2006-fulton-county-georgia-lidar",nt"isopen":
    false,nt"url": null,nt"notes": "The Light Detection and Ranging (LiDAR)
    LAS dataset is a survey of Fulton County. The Fulton County LiDAR Survey project
    area consists of approximately 690.5 square miles. The LiDAR point cloud was flown
    at a density sufficient to support a maximum final post spacing of 5 meters for
    unobscured areas. 3001 Inc. acquired 75 flightlines between March 3, 2006 and March
    6, 2006 and 120 flightlines were reflown between July 29, 2006 and August 4, 2006.
    The data was divided into 5000' by 5000' foot cells that serve as the tiling scheme.
    The Fulton County LiDAR Survey was collected under the guidance of a Professional
    Mapper/Surveyor.",nt"license_title": null,nt"extras": [{ntt"key":
